import { useState } from "react";
import BodyCarousel from "./components/BodyCarousel";
import Footer from "./components/Footer";
import MainContent from "./components/MainContent";
import Navbar from "./components/Navbar";
import FrequentlyAskedQuestions from "./components/FrequentlyAskedQuestions";
import AdminLogin from './components/AdminLogin';
import { Route, Switch } from "react-router-dom/cjs/react-router-dom.min";

function App() {
  const [bodyCarousal, setBodyCarousal] = useState(true);
  const [signIn, setSignIn] = useState(false);
  const [FAQ, setFAQ] = useState(false);
  const [adminLogin, setAdminLogin] = useState(false);
  var toggleSignIn = () => {
    setBodyCarousal(false);
    setSignIn(true);
    setFAQ(false);
    setAdminLogin(false);
  }
  var toggleBodyCarousal = () => {
    setBodyCarousal(true);
    setSignIn(false);
    setFAQ(false);
    setAdminLogin(false);
  }
  var toggleFAQ = () => {
    setBodyCarousal(false);
    setSignIn(false);
    setFAQ(true);
    setAdminLogin(false);
  }
  var toggleAdminLogin = () => {
    setBodyCarousal(false);
    setSignIn(false);
    setFAQ(false);
    setAdminLogin(true);
  }
  return (
    <>
      <Navbar toggleSignInHandler={toggleSignIn} toggleBodyCarousalHandler={toggleBodyCarousal} toggleFAQHandler={toggleFAQ} toggleAdminLoginHandler={toggleAdminLogin} />
      {bodyCarousal ? <BodyCarousel /> : null}
      {FAQ ? <FrequentlyAskedQuestions /> : null}
      {signIn ? <MainContent /> : null}
      {adminLogin ? <AdminLogin /> : null}
      <Switch>
        <Route path="/" exact component={MainContent} />
        <Route path="/home" exact component={MainContent} />
      </Switch>
      <Footer />
    </>
  );
}

export default App;
